import { LOAD_DROPBOX_DATA } from "./types"
import axios from 'axios'
import { Dropbox } from "dropbox"

var dbx = new Dropbox({ 
  accessToken: 'sl.BAsHkQW80K0yUwgZRrH_z1c3y4XFK4QbQ8xllPvLNTaMXsYlF4BBuguvGjoYdA9QI1mHELrk-YutWHma2L9apWaGcHrijjXreq6oCR2_FrqmWk4zGHYqqFgX60JdMqIGXt0wsZc',
  fetch
});

dbx.usersGetCurrentAccount()
  .then(function(response) {
    console.log(response);
  })
  .catch(function(error) {
    console.error(error);
  });

dbx.filesListFolder({path: ''})
.then(function(response) {
console.log(response.entries);
})
.catch(function(error) {
console.error(error);
});


export const loadData = () => async dispatch => {
    try{
        let usResponse = await axios.get('https://api.covidtracking.com/v1/us/current.json')
        let statesResponse = await axios.get('https://api.covidtracking.com/v1/states/current.json')
        dispatch({
            type: LOAD_DROPBOX_DATA,
            data: {
                usData: usResponse.data[0],
                stateData: statesResponse.data
            }
        })
    } catch(err){
        console.log('err:', err)
    }
}
